import styled from 'styled-components';
import IntervalsCountDisplay from './IntervalsCountDisplay';

const TopHalf = styled.div`
background: transparent;
border-bottom: 2px solid black;
margin: 13px -5px;
position: absolute;
left: 0px;
width: 90%;
height: 200px;
`
const BottomHalf = styled.div`
background: transparent;
border-bottom: 2px solid black;
margin: 13px -5px;
position: absolute;
left: 0px;
width: 100%;

height: 600px;
`

const TopHalfLeft = styled.div`
position: absolute;
width: 30%;
left: 0%;
height: 100%;
bottom: 0%;
border-right: 2px solid black;
`
const Label1 = styled.h1`
font-size: 175%;
text-align: center;
font-weight: normal;
`
const Label2 = styled.h1`
font-size: 200%;
text-align: left;
position: absolute;
margin-left: 1%;
margin-top: .3%;
top: 200px;
font-weight: normal;
`

const IntervalPerRideCount = styled.div`
height: 82%;
padding-left: 2%;
padding-right: 2%;
padding-bottom: 2%;
padding-top: 2%;
border-top: 2px solid black;
overflow: hidden;
overflow-y: scroll;
`
const ParkwideIntervalsContainer = styled.div`
position: absolute;
width:90%;
height: 45%;
bottom: 0px;
border-top: 2px solid black;
border-right: 2px solid black;
`

const AttractionIntervals = () => {
    return (
        <>
            <TopHalf>
                <TopHalfLeft>
                    <Label1> Attraction Intervals </Label1>
  
                    <IntervalsCountDisplay></IntervalsCountDisplay>

                </TopHalfLeft>
            </TopHalf>
            <BottomHalf>
                <Label2>Parkwide Intervals </Label2>
                <ParkwideIntervalsContainer></ParkwideIntervalsContainer>
            </BottomHalf>
        </>
    )
}

export default AttractionIntervals
